import React from 'react'
import styled from 'styled-components'
const DashboardScreen = () => {
  return (
    <Wrapper>
    <div className='dashboxes'>
      <div></div>
      <div></div>
      <div></div>
      <div></div>
      <div></div>
      <div></div>
    </div>
    </Wrapper>
   
  )
}

export default DashboardScreen


const Wrapper = styled.div`

.dashboxes {
  width: 90%;
  display: flex;
  
}

`
